        "description": "Einstein‚Äôs special theory of relativity is notorious for being easy to misuse, with the result that sometimes result in claims of paradoxes.  When one digs more carefully into the theory, you find that no such paradoxes actually exist.  In this video, Fermilab‚Äôs Dr. Don Lincoln describes a commonly claimed time dilation paradox and shows how to resolve it.\n\nRelated videos:\nhttps://www.youtube.com/watch?v=qXxtqK7G4Uw\nhttps://www.youtube.com/watch?v=CB1QFUCga0I\nhttps://www.youtube.com/watch?v=Txv7V_nY2eg",
